import Navbar from "./Navbar";
import { useAuth0 } from "@auth0/auth0-react";

const NotResponse = ()=> {
    return (
        <h1>Please Login to view profile</h1>
    );
}

const AuthResponse = ()=> {
    const { user } = useAuth0();
    return (
        <>
            <img src={user.picture} alt={user.given_name}></img>
            <h1>{user.email}</h1>
            <h1>{user.given_name}</h1>
            <h1>{user.family_name}</h1>
        </>
    );
}

function Profile() {
    const {isAuthenticated,isLoading } = useAuth0();

    return (
        <div>
            {isLoading}
            <Navbar/>
            {
                !isAuthenticated ? <NotResponse/> :<AuthResponse/>
            }
        </div>
    );
}

export default Profile;
